import react from "react"

const BlockFilm = (props) => {



return (
    props.cities.map((item) => {
        <div className="card">
            <div className="card-header">
                <h1>{item.name}</h1>
            </div>
            <div className="card-body">
                <h5 className="card-title">{item.population}</h5>
                <p className="card-text">Данные про фильм</p>
                <a href="#" className="btn btn-primary">Перейти на фильм</a>
            </div>
        </div>
    })
)

}

export default BlockFilm;
